import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, useLocation } from 'react-router-dom';

export default function Checkout() {
  const [customerName, setCustomerName] = useState('');
  const [phone, setPhone] = useState('');
  const [address, setAddress] = useState('');
  const [message, setMessage] = useState('');
  const navigate = useNavigate();
  const location = useLocation();
  
  // Get cart items and total from location state or localStorage
  const cartItems = location.state?.cartItems || JSON.parse(localStorage.getItem('cart')) || [];
  const total = cartItems.reduce((sum, item) => sum + item.price, 0);

  const placeOrder = () => {
    if (!customerName || !phone) {
      setMessage('Please fill required fields');
      return;
    }

    if (cartItems.length === 0) {
      setMessage('Your cart is empty');
      return;
    }

    axios.post("http://localhost:5000/orders", { 
      customer_name: customerName,
      total: total,
      items: cartItems // This will be stored in database
    })
      .then(() => {
        setMessage('Order placed successfully! Thank you!');
        // Clear cart
        localStorage.removeItem('cart');
        // Redirect to home after 3 seconds
        setTimeout(() => navigate('/'), 3000);
      })
      .catch(err => {
        console.log(err);
        setMessage('Error placing order');
      });
  };

  if (cartItems.length === 0) {
    return (
      <section className="container pad">
        <h2 className="red">Checkout</h2>
        <p>Your cart is empty. Add items from the menu first.</p>
        <button onClick={() => navigate('/menu')} className="btn">
          Go to Menu
        </button>
      </section>
    );
  }

  return (
    <section className="container pad">
      <h2 className="red">Checkout</h2>
      
      <div className="order-summary mb">
        <h3>Order Summary</h3>
        {cartItems.map((item, index) => (
          <div key={index} className="cart-item">
            <span>{item.name} - ${item.price}</span>
          </div>
        ))}
        <h4 className="red">Total: ${total.toFixed(2)}</h4>
      </div>

      <div className="form-section">
        <h3>Customer Information</h3>
        
        {message && <p className={message.includes('success') ? 'green' : 'red'}>{message}</p>}
        
        <div className="form-group">
          <label>Full Name *</label>
          <input 
            type="text" 
            value={customerName}
            onChange={e => setCustomerName(e.target.value)}
            className="form-input"
            required
          />
        </div>

        <div className="form-group">
          <label>Phone Number *</label>
          <input 
            type="tel" 
            value={phone}
            onChange={e => setPhone(e.target.value)}
            className="form-input"
            required
          />
        </div>

        <div className="form-group">
          <label>Delivery Address (if delivery)</label>
          <textarea 
            value={address}
            onChange={e => setAddress(e.target.value)}
            className="form-input"
            rows="2"
            placeholder="Street, City"
          />
        </div>

        <button onClick={placeOrder} className="btn">
          Place Order (${total.toFixed(2)})
        </button>
      </div>
    </section>
  );
}
